import './App.css';


function App() {



  return (
    <Router>
      <Routes>
      <Route path="/" element={<FrontPage/>}>    
      </Route>
          <Route path="/fight" element={<FightPage/>}/>
            
      
      </Routes>
    
</Router>
  );
}

export default App;
